export const enum ACTIVITY_STATUS {
  /**
   * 已发布 已开始
   */
  PUBLISHED = 1,
  /**
   * 已发布 但未开始
   */
  STARTED = 2,
  /**
   * 已结束
   */
  END = 3,
  /**
   * 草稿
   */
  DRAFT = 4,
  /**
   * 已取消
   */
  CANCEL = 5
}
